import useStats from "../utils/useStats.js"

function CountryDisplay() {
    const countries = useStats('http://covid19.mathdro.id/api/count');
    if(!countries) return <p>Loading...</p>
    return (
    <div>
       <p>Countries</p>
    </div>
    )
}

export default CountryDisplay
